  \"2016-03-21T18:48:31.591859\",\n\t\"name\": \"chinook-bycatch-contemporary-salmon-genetic-stock-composition-estimates\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"1. The purpose of this project is to measure
  and monitor impacts on ESA-listed populations and to estimate overall Chinook salmon
  stock composition in bycatch associated with the hake fisheries (including tribal
  and non-tribal, shoreside, and at-sea). The work is carried out by NOAA staff.nn2.
  Fin clips collected by NOAA observers are characterized genetically allowing allocation
  of the mixture to source populations.nn3. Written reports are produced regularly
  and forwarded to the NWR and interested parties.nn4. The NWR is the primary management
  audience in facilitation of NOAA's MSA obligations to measure and monitor ESA impacts.nn5.
  This is an ongoing project (see also Historical Salmon Genetic Stock Composition
  Estimates). nn6. This is a stand-alone project in one sense, but is closely coordinated
  with stock composition studies in directed harvest as well as similar studies of
  historical bycatch using archival scale material. nn7. There are no specific hard
  deadlines associated with this project.nnChinook genetics bycatch in hake.\",\n\t\"license_title\":
